import React from "react";
import Nav from "./components/nav";
import ToyDisplay from "./components/toysDisplay";
import toys from "./toys.js";

function App() {
    return (
      <div>     
        <Nav />
        {toys.map(toy => 
          <ToyDisplay 
          image={toy.image}
          cost={toy.cost}
          />
        )}
      </div>
    )
}

export default App;
